import React from "react";
import { Row, Col } from "reactstrap";
import Form from "reactstrap/lib/Form";
import Widget from "../../components/Widget/Widget";
import styles from "./organization.module.scss";
import { useState, useEffect } from 'react';
import axios from "axios";
import PropTypes from "prop-types";


class organizationD extends React.Component {


  constructor(props) {
    super(props);

    this.state = {
     Dteam1: "", 
     Dteam2: "",
     Dteam3: "", 
     Dteam4: "", 
     Dteam5: "", 
     Dteam7: "", 
     Dteam7: "",
     Dteam8: "", 
    };
  }


    componentDidMount(){
      this.setState({ status: true });

      this.findCtrP();
      this.findTestAI();
      this.findVS();
      this.findCtrF();
      this.findTestF();
      this.findADAS();
      this.findIBigdata();
      this.findIntern();
    }

    componentWillUnmount() {
      this.setState({ status: false });
    }

    findCtrP() {
       axios.get('http://process.env.REACT_APP_API_URL/Dteam1')
       .then(res=>res.data)
        .then((data)=>{
          this.setState({Dteam1:data});
    });
  }

  findTestAI() {
    axios.get('http://process.env.REACT_APP_API_URL/Dteam2')
    .then(res=>res.data)
     .then((data)=>{
       this.setState({Dteam2:data});
 });
}

findVS() {
  axios.get('http://process.env.REACT_APP_API_URL/Dteam3')
  .then(res=>res.data)
   .then((data)=>{
     this.setState({Dteam3:data});
});
}

findCtrF() {
  axios.get('http://process.env.REACT_APP_API_URL/Dteam4')
  .then(res=>res.data)
   .then((data)=>{
     this.setState({Dteam4:data});
});
}

findTestF() {
  axios.get('http://process.env.REACT_APP_API_URL/Dteam5')
  .then(res=>res.data)
   .then((data)=>{
     this.setState({Dteam5:data});
});
}

findADAS() {
  axios.get('http://process.env.REACT_APP_API_URL/Dteam6')
  .then(res=>res.data)
   .then((data)=>{
     this.setState({Dteam6:data});
});
}

findIBigdata() {
  axios.get('http://process.env.REACT_APP_API_URL/Dteam7')
  .then(res=>res.data)
   .then((data)=>{
     this.setState({Dteam7:data});
});
}

findIntern() {
  axios.get('http://process.env.REACT_APP_API_URL/Dteam8')
  .then(res=>res.data)
   .then((data)=>{
     this.setState({Dteam8:data});
});
}




   
    
    render() {
      const { isOpen, close } = this.props;
      return (
        <div className="pricingTable">
        <h2 className="pricingTable-title">임베디드기술연구소</h2>
        <h3 className="pricingTable-subtitle">조민성 전문위원</h3>
        
        <ul className="pricingTable-firstTable">
          <li className="pricingTable-firstTable_table">
            <h1 className="pricingTable-firstTable_table__header">제어성능검증팀</h1>
            {this.state.Dteam1 ? this.state.Dteam1.map(c => {
              if(c.직위 === '수석')
                return(
                  <p className="pricingTable-firstTable_table__pricing"><span>{c.이름}</span><span>팀장</span></p>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
            <ul className="pricingTable-firstTable_table__options">
            {this.state.Dteam1 ? this.state.Dteam1.map(c => {
              if(c.직위 === '수석' || c.직위 === '책임')
                return(
                <li className="li_first">{c.이름}({c.직위})</li>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
              {this.state.Dteam1 ? this.state.Dteam1.map(c => {
              if(c.직위 === '선임')
                return(
                <li className="li_second">{c.이름}({c.직위})</li>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
              {this.state.Dteam1 ? this.state.Dteam1.map(c => {
              if(c.직위 === '전임')
                return(
                <li className="li_third">{c.이름}({c.직위})</li>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
               </ul>

               
          </li>

          <li className="pricingTable-firstTable_table">
            <h1 className="pricingTable-firstTable_table__header">검증자동화팀</h1>
            {this.state.Dteam2 ? this.state.Dteam2.map(c => {
              if(c.직위 === '수석')
                return(
                  <p className="pricingTable-firstTable_table__pricing"><span>{c.이름}</span><span>팀장</span></p>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
            {/* <p className="pricingTable-firstTable_table__pricing"><span>권민혁</span><span>팀장</span></p> */}
            <ul className="pricingTable-firstTable_table__options">
            {this.state.Dteam2 ? this.state.Dteam2.map(c => {
              if(c.직위 === '책임' || c.직위 === '수석')
                return(
                <li className="li_first">{c.이름}({c.직위})</li>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
              {this.state.Dteam2 ? this.state.Dteam2.map(c => {
              if(c.직위 === '선임')
                return(
                <li className="li_second">{c.이름}({c.직위})</li>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
              {this.state.Dteam2 ? this.state.Dteam2.map(c => {
              if(c.직위 === '전임')
                return(
                <li className="li_third">{c.이름}({c.직위})</li>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
                  );
              })  :""}
               </ul>

               
          </li>

          <li className="pricingTable-firstTable_table">
            <h1 className="pricingTable-firstTable_table__header">가상화기술팀</h1>
            {this.state.Dteam3 ? this.state.Dteam3.map(c => {
              if(c.직위 === '수석')
                return(
                  <p className="pricingTable-firstTable_table__pricing"><span>{c.이름}</span><span>팀장</span></p>
                 // 위에 선언한 state equips 의 모든 값을 반복문으로 리턴해옴 if문을 해준 이유는 data 를 get 하는 속도보다 코드 읽는 속도가 더 빠르기 때문에 debug를 위해
